import React, { Component } from 'react';
import './App.css';
import { Table, Container, Button } from 'react-bootstrap'

import ModalNew from './Modal'

class Visualizacao extends Component {
  constructor(props) {
    super(props)
    this.state = {
      value: false
    }
  }
  render() {
    return (
      <div>
        <Container>
          <Table striped bordered hover>
            <thead>
              <tr>
                {this.props.colunas.map((item, key) => <th key={key}> {item} </th>)}
              </tr>
            </thead>
            <tbody>
              {this.props.users.filter(
                (valores, index) => index >0 && index < 10)
                .map((item, indice) =>
                  <tr key={indice}>
                    <td>{item.id}</td>
                    <td>{item.nome}</td>
                    <td>{item.cnpj}</td>
                    <td>{item.insc}</td>
                    <td>{item.latitude}</td>
                    <td>{item.longitude}</td>
                    <td><Button variant="primary" onClick={this.setState({...this.state,value:true})} >Primary</Button>{' '}<Button variant="danger" onClick={() => this.props.removeUser(item)}>Remove</Button>
                    <Button variant="primary" onClick={() => console.log(this.state.value)} >Primary</Button>
                    </td>
                  </tr>
                )}
            </tbody>
          </Table>
          <ModalNew valor={this.state.value} />
        </Container>
      </div >
    )
  }
}
export default (Visualizacao);
